import styled from "styled-components";


const Ex = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  margin: 90px 0px 100px 0px;
`;
const Headtext = styled.h1`
  font-size: 45px;
  font-weight: 300;
  height: 58px;
`;
const Intext = styled.p`
  word-spacing: -2px;
  width: 100%;
  text-align: center;
  font-size: 23px;
  line-height: 1.5;
  color: #6c6a6a;
  margin-bottom: 25px;
`;
const Headbtn1 = styled.button`
  align-content: center;
  padding: 10px 10px 25px 10px;
  width:150px ;
  height: 40px;
  margin : auto;display: block;
  background-color: #007bff;
  color: #fff;    border-color: #007bff;
  display: inline-block;
  margin-left: 600px;
  border-radius: 3px;
  margin-top: 30px;
  margin-right: 5px;
  font-size: 17px;
  border: 1px;
  cursor: pointer;
`;

const Headbtn2 =styled.button`
   padding: 10px 10px 25px 10px;
border: 1px;
margin-left: 50px;
   text-align: center;
   font-size: medium;
    width  :auto ;
  height: 30px;
  margin : auto;display: block;
  color: #fff;
    background-color: #6c757d;
    border-color: #6c757d;
    display: inline-block;
    border-radius: 3px;
    cursor: pointer;
`;


const Maincomponent =  (props) => {
  return (
    <Ex>
      <Headtext>Album example</Headtext>
      <Intext>
        Something short and leading about the collection below—its contents,
        <br />, the creator, etc. Make it short and sweet, but not too short so
        folks don’t <br /> simply skip over it entirely 
        </Intext>
        <Headbtn1>Main call to action</Headbtn1>
        <Headbtn2>Secondary action</Headbtn2>  
    </Ex>
  );
};

export default Maincomponent;
